import { Link } from "react-router-dom";
import { FaFacebook, FaInstagram, FaTwitter, FaYoutube } from "react-icons/fa";

function Social() {
  return (
    <div className="social">
      <div className="flex">
        <Link to="#">
          <FaFacebook />
        </Link>
        <Link to="#">
          <FaTwitter />
        </Link>
        <Link to="#">
          <FaInstagram />
        </Link>
        <Link to="#">
          <FaYoutube />
        </Link>
      </div>
    </div>
  );
}

export default Social;
